riot.tag2('tasks', '<div if="{task_list}"> <h3 class="tasks__title"> <i class="fa fa-list"></i> {task_list.name} </h3> <form class="tasks__add-form" onsubmit="{add}"> <input class="input" name="name" type="text" value="{new_task.name}"><textarea class="input" if="{detail_is_shown}" name="memo" rows="3">{new_task.memo}</textarea> <div class="tasks__add-form__btns"> <button class="btn" onclick="{toggle_detail_shown}" type="button"><i class="fa fa-chevron-circle-down" if="{!detail_is_shown}"></i><i class="fa fa-chevron-circle-up" if="{detail_is_shown}"></i> Detail</button><button class="btn"><i class="fa fa-plus"></i> Add</button> </div> </form> <button class="btn u-mgb-10" onclick="{toggle_done_shown}" type="button"><i class="fa fa-eye"></i> Show done</button> <ul class="tasks__lists"> <li class="tasks__list" each="{task, i in task_list.tasks}" if="{!task.done || done_is_shown}"> <div if="{!task.is_editing}"> <label class="tasks__list__label {done: task.done}"><input __checked="{task.done}" class="tasks__list__checkbox" onclick="{toggle}" type="checkbox">{task.name}<span class="task__list__memo" show="{task.memo}">- {task.memo}</span></input></label> <div class="tasks__list__btns"> <button class="btn" onclick="{toggle_editing}" type="button"><i class="fa fa-pencil"></i></button><button class="btn" onclick="{delete}" type="button"><i class="fa fa-trash"></i></button> </div> </div> <form class="tasks__list__edit-form" if="{task.is_editing}" onsubmit="{edit}"> <input class="input" name="name" type="text" value="{task.name}"><textarea class="input" name="memo" rows="3" value="{task.memo}"></textarea> <div class="tasks__list__edit-form__btns"> <button class="btn"><i class="fa fa-check"></i> Edit</button><button class="btn" onclick="{delete}" type="button"><i class="fa fa-trash"></i> Delete</button><button class="btn" onclick="{toggle_editing}" type="button"><i class="fa fa-times"></i> Close</button> </div> </form> </li> <li class="tasks__list" if="{false}"> <div class="tasks__list__label"> No tasks. </div> </li> </ul> </div>', '', 'class="tasks"', function(opts) {
    this.task_list = opts.task_list;
    this.task_lists = riot.collections.task_lists;
    this.tasks = riot.collections.tasks;
    this.detail_is_shown = false;
    this.done_is_shown = false;
    this.new_task = {};

    var self = this;

    this.toggle_detail_shown = function(e) {
      this.detail_is_shown = !this.detail_is_shown;
    }.bind(this)

    this.toggle_done_shown = function(e) {
      this.done_is_shown = !this.done_is_shown;
    }.bind(this)

    this.add = function(e) {
      for(var i = 0; i < e.srcElement.length; i++) {
        if ( e.target[i].name ) {
          self.new_task[e.target[i].name] = e.target[i].value;
        }
      }
      var params = self.new_task;
      params.task_list_id = self.task_list.id;

      self.tasks.trigger('post', {task: params}, function(){
        self.new_task = {};
        self.trigger('changed');
      });
    }.bind(this)

    this.toggle = function(e) {
      var task = e.item.task
      task.done = !task.done

      self.tasks.trigger('patch', task.id, {task: task}, function(){
        self.trigger('changed');
      });
      return true
    }.bind(this)

    this.toggle_editing = function(e) {
      var task = e.item.task
      task.is_editing = !task.is_editing;
    }.bind(this)

    this.edit = function(e) {
      var task = e.item.task
      task.is_editing = false;

      var form = e.srcElement,
          params = _.reduce(form, function(params, elem){
            if ( elem.name ) {
              params[elem.name] = elem.value;
              task[elem.name] = elem.value;
            }
            return params
          }, {});

      self.tasks.trigger('patch', task.id, {task: params});
    }.bind(this)

    this.delete = function(e){
      var task = e.item.task;

      if ( confirm('削除しますか？') ) {
        self.tasks.trigger('delete', task.id, function(){
          self.trigger('changed');
        });
      }
    }.bind(this)

    self.on('changed', function(){
      if(self.task_list) {
        self.task_lists.trigger('get_one', self.task_list.id, function(task_list){
          self.update({ task_list: task_list });
        });
      }
    });

    riot.event.on('change_selected_task_list', function(selected_task_list) {
      self.new_task = {};
      self.update({ task_list: selected_task_list });
    });
});

riot.tag2('task_lists', '<h2 class="taskLists__title"> <i class="fa fa-list"></i> Task list </h2> <ul class="taskLists__lists"> <li class="taskLists__list" each="{task_list, i in task_lists.models}"> <div if="{!task_list.is_editing}"> <a class="taskLists__list__name" onclick="{open}">{task_list.name}</a><button class="btn taskLists__list__btn-edit" onclick="{toggle_editing}" type="button"><i class="fa fa-pencil"></i></button> </div> <form class="taskLists__list__edit-form" if="{task_list.is_editing}" onsubmit="{edit}"> <input class="input" name="name" type="text" value="{task_list.name}"> <div class="taskLists__list__edit-form__btns"> <button class="btn"><i class="fa fa-check"></i></button><button class="btn" onclick="{delete}" type="button"><i class="fa fa-trash"></i></button><button class="btn" onclick="{toggle_editing}" type="button"><i class="fa fa-times"></i></button> </div> </form> </li> </ul> <form class="taskLists__list__edit-form" onsubmit="{add}"> <input class="input" name="name" onkeyup="{input}" type="text"> <div class="taskLists__list__edit-form__btns"> <button class="btn"><i class="fa fa-plus"></i></button> </div> </form>', '', 'class="taskLists"', function(opts) {
    var self = this;

    self.task_lists = riot.collections.task_lists;
    self.selected_task_list;

    self.task_lists.on('updated', function(){
      self.update();
    });

    self.new_task_list = {};

    this.input = function(e) {
      self.new_task_list.name = e.target.value;
    }.bind(this)

    this.add = function(e) {
      var params = self.new_task_list;

      self.task_lists.trigger('post', {task_list: params});
    }.bind(this)

    this.open = function(e) {
      self.selected_task_list = e.item.task_list;
      riot.event.trigger('change_selected_task_list', self.selected_task_list)
      riot.route('open/' + e.item.task_list.id)
    }.bind(this)

    this.delete = function(e){
      var task_list = e.item.task_list;

      if ( task_list.tasks.length > 0 ) {
        alert('タスクがあるリストは削除できません。')
      } else if ( confirm('削除しますか？') ) {
        self.task_lists.trigger('delete', task_list.id);
      }
    }.bind(this)

    this.toggle_editing = function(e) {
      var task_list = e.item.task_list
      task_list.is_editing = !task_list.is_editing;
    }.bind(this)

    this.edit = function(e) {
      var task_list = e.item.task_list
      task_list.is_editing = false;

      var form = e.srcElement,
          params = _.reduce(form, function(params, elem){
            if ( elem.name ) {
              params[elem.name] = elem.value;
              task_list[elem.name] = elem.value;
            }
            return params
          }, {});

      self.task_lists.trigger('patch', task_list.id, {task_list: params});
    }.bind(this)
});

(function () {
  //------ riot拡張 ------------
  //riot.event 全riot独自タグ内でイベント感知できるように
  riot.event = riot.observable();

  //riot.getData タグからdata-○○属性を取得
  riot.getData = function (dom, name) {
    if (!document.createElement('div').dataset) {
      return dom.getAttribute('data-' + name);
    }
    return dom.dataset[name];
  }

  //riot.createCollection リモートからデータをAjaxで取得して、モデル群を保持
  riot.createCollection = function (opts) {
      var collection = riot.observable(),
        opts = opts || {};

      collection.remote = opts.remote;
      collection.params = '';
      collection.isReady = function () {
        return (this.models && this.models.length > 0);
      }

      collection.on('get', function (callback) {
        var co = this;
        reqwest({
          url: this.remote + '?' + co.params,
          method: 'get',
          success: function (res) {
            var models = res;
            co.models = models;
            if (typeof callback === 'function') callback(res);
            co.trigger('updated');
          }
        });
      });

      collection.on('get_one', function (id, callback) {
        var co = this;
        if (typeof id !== 'number') return;
        reqwest({
          url: this.remote + '/' + id,
          method: 'get',
          success: function (res) {
            var model = res,
                index = _.findIndex(co.models, ['id', id]);
            co.models[index] = model;
            if (typeof callback === 'function') callback(model);
            co.trigger('updated');
          }
        });
      });

      collection.on('post', function (params, callback) {
        var co = this;
        if (!params) return;
        reqwest({
          url: this.remote,
          method: 'post',
          data: params,
          success: function (res) {
            if (typeof callback === 'function') callback(res);
            co.trigger('get');
          }
        });
      });

      collection.on('patch', function (id, params, callback) {
        var co = this;
        if (typeof id !== 'number' || !params) return;
        reqwest({
          url: this.remote + '/' + id,
          method: 'put',
          data: params,
          success: function (res) {
            if (typeof callback === 'function') callback(res);
            co.trigger('get');
          }
        });
      });

      collection.on('delete', function (id, callback) {
        var co = this;
        if (typeof id !== 'number') return;
        reqwest({
          url: this.remote + '/' + id,
          method: 'delete',
          success: function (res) {
            if (typeof callback === 'function') callback(res);
            co.trigger('get');
          }
        });
      });
      collection.trigger('get'); //あとでrouteと合わせてparamを連動するよう修正

      return collection;
    }

  //-------------------------------
  
  //モデル群
  riot.collections = {
    tasks: riot.createCollection({
      remote: '/tasks'
    }),
    task_lists: riot.createCollection({
      remote: '/task_lists'
    }),
    users: riot.createCollection({
      remote: '/users'
    })
  }

  //タグをマウント
  riot.mount('*');
})();
